Краткое описание:
В составе высокого двустороннего матраса  <strong>Swell</strong> сочетаются слои  высокотехнологичных экологически чистых пен: упругая пена повышенной плотности, благодаря которой матрас приобретает оптимальную жесткость, и эластичная пена с эффектом памяти, которая подстраивается под все изгибы вашего тела, снимая напряжение с мышц. Матрас отлично подойдет для активных людей.

Независимый пружинный блок<strong> SupportMax1000, </strong>отлично выдерживающий высокие нагрузки, обеспечит точечную и упругую поддержку тела и позвоночника во время сна.

